import "./projectField.css";
import { useState, Form } from "react";

function ProjectField() {
  return (
    <Form>
      {projectDetails.map((data) => (
        <div className="project-list" key={data.id}>
          <h5>{data.name}</h5>
          <h5>{data.date}</h5>
          <h5>{data.deadLine}</h5>
          <h5>In progress</h5>
        </div>
      ))}
    </Form>
  );
}

export default ProjectField;
